import React from "react";
const Compo1 = (props) => {
  return (
    <div className="todo_style">
      <span>
        <i className="fa fa-times" aria-hidden="true"></i>
      </span>
      <li>{props.text}</li>;
    </div>
  );
};

export default Compo1;
